import React from 'react';
import { Button, Typography, makeStyles } from "@material-ui/core";
import { Link } from "react-router-dom";

import MenuIcon from "@material-ui/icons/Menu";
import MenuOpenIcon from "@material-ui/icons/MenuOpen";

// import AcountModal from '../NewHeader/AcountModal';
import DrawerComponent from './DrawerComponent';

const useStyles = makeStyles((theme) => ({
    main: {
        boxSizing: 'border-box',
        margin: 0,
        padding: 0,
        backgroundColor: "#24252A",
    },
    header: {
        display: "flex",
        justifyContent: 'space-between',
        alignItems: "center",
        padding: "30px 10%",
    },
    buttonText: {
        color: "white",
    },
    ul: {
        listStyle: "none",
    },
    li: {
        display: "inline-block",
        padding: "0px 20px"
    }
}))

const Header = () => {
    const classes = useStyles();
    return (
        <div className={classes.main}>
            <div className={classes.header}>
                <DrawerComponent />
                {/* <Button variant="text" size="large" component={Link} to={"/"}>
                </Button> */}

                <Typography className={classes.buttonText} variant="h6">Jonathan Meisner</Typography>
                <ul className={classes.ul}>
                    <li className={classes.li}>
                        <Button variant="text" component={Link} to={"/"}>
                            <Typography className={classes.buttonText} variant="body2">Home</Typography>
                        </Button>
                    </li>
                    <li className={classes.li}>
                        <Button variant="text" component={Link} to={"/bank"}>
                            <Typography className={classes.buttonText} variant="body2">Bank</Typography>
                        </Button>
                    </li>
                    <li className={classes.li}>
                        <Button variant="text" component={Link} to={"/cards"}>
                            <Typography className={classes.buttonText} variant="body2">Cards</Typography>
                        </Button>
                    </li>
                    <li className={classes.li}>
                        <Button variant="text" component={Link} to={"/settings"}>
                            <Typography className={classes.buttonText} variant="body2">Settings</Typography>
                        </Button>
                    </li>
                    {/* <li className={classes.li}>
                        <Button variant="text" component={Link} to={"/login"}>
                            <Typography className={classes.buttonText} variant="body2">Login</Typography>
                        </Button>
                    </li> */}
                </ul>
                {/* <Button variant="text">
                    <Typography className={classes.buttonText} variant="body2">Home</Typography>
                </Button> */}
                <div style={{ display: "flex" }}>
                    <Button variant="text" component={Link} to={"/login"}>
                        <Typography className={classes.buttonText} variant="body2">Login</Typography>
                    </Button>
                    {/* <AcountModal /> */}
                </div>
            </div>
        </div>
    )
}

export default Header;
